import React from "react";
import TextField from "@mui/material/TextField";
import "./Register.css";

function Register() {
  return (
    <>
      <div className="reg-form">
        <TextField type="" className="reg-input" required label="NAME" />
        <TextField type="" className="reg-input" required label="USERNAME" />
        <TextField type="" className="reg-input" required label="EMAIL" />
        <TextField type="" className="reg-input" required label="PASSWORD" />
      </div>
    </>
  );
}

export default Register;
